	LOAD_MY_INFO_SUCCESS,
	LOAD_MY_INFO_FAILURE,
	// 프로필 수정
	EDIT_PROFILE_REQUEST,
	EDIT_PROFILE_SUCCESS,
	EDIT_PROFILE_FAILURE,
	// 일지 리스트 가져오기
	FETCH_NOTE_LIST_REQUEST,
	FETCH_NOTE_LIST_SUCCESS,
	FETCH_NOTE_LIST_FAILURE,
	// 일지 쓰기
	ADD_NOTE_REQUEST,
	ADD_NOTE_SUCCESS,
	ADD_NOTE_FAILURE,
	// 일지 하나 가져오기
	FETCH_NOTE_REQUEST,
	FETCH_NOTE_SUCCESS,
	FETCH_NOTE_FAILURE,
	// 메뉴에서 항목 선택
	SELECT_MENU_REQUEST,
};
